import './Home.css';
import React, { Component } from 'react';

export default function Home() {
    return ( 
        <div className="home">
            <div className="name-box">
                <div className="name">I'm <span>Anqi</span> Chen.</div>
            </div>

            <div className="intro">
                <div className="intro-text">I study Architecture and Human-Computer Interaction <br></br>@ Carnegie Mellon University.<br></br>
                Actively seeking opportunity to explore <span className="span-bold">Development & Design </span>for <span className="span-bold">Inclusion & Improvement</span>. </div>
            </div>

        </div>
    );
}
